Since a container is just a process, we need to create the child process for the container. The create_child_process function is responsible for that. fn run() -> ContainerResult { let cli = Cli::parse(); ... let child_pid = create_child_process(&config)?; if let Err(e) = waitpid(child_pid, None) { return Err(ContainerError::WaitPid); }; Ok(())
} After creating the child process, we need to make sure the parent process doesn't terminate until the child process completes. We use the waitpid call to make sure of that. Here is the implementation for create_child_process: // Creates a child process with clone and runs the executable file
// with execve in the child process.
fn create_child_process(config: &ChildConfig) -> Result<Pid, ContainerError> { let mut flags = CloneFlags::empty(); flags.insert(CloneFlags::CLONE_NEWNS); flags.insert(CloneFlags::CLONE_NEWCGROUP); flags.insert(CloneFlags::CLONE_NEWPID); flags.insert(CloneFlags::CLONE_NEWIPC); flags.insert(CloneFlags::CLONE_NEWNET); flags.insert(CloneFlags::CLONE_NEWUTS); let mut stack = [0; STACK_SIZE]; let clone_res = unsafe { clone( Box::new(|| match child(config) { Ok(_) => 0, Err(_) => -1, }), &mut stack, flags, Some(Signal::SIGCHLD as i32), // If the signal SIGCHLD is ignored, waitpid will hang until the // child exits and then fail with code ECHILD. ) }; match clone_res { Ok(pid) => { println!("Child pid: {:?}", pid); Ok(pid) } Err(_) => Err(ContainerError::Clone), }
} It uses clone to create the child process. It clones with a bunch of flags such as CLONE_NEWNS, CLONE_NEWPID, etc in order to create the different namespaces (user, mount, pid, etc) necessary for isolation. We will cover these namespaces in more detail later. The Linux clone method takes a function argument. When the function returns, the child process terminates. The function we pass to clone is the child method whose responsibility is to set up the container environment and execute the user-provided program.

