For my project, I disabled the same set of syscalls that Lizzie’s implementation of container disables. Here is the implementation: const DISABLED_SYSCALLS: [Syscall; 9] = [ Syscall::keyctl, Syscall::add_key, Syscall::request_key, Syscall::ptrace, Syscall::mbind, Syscall::migrate_pages, Syscall::set_mempolicy, Syscall::userfaultfd, Syscall::perf_event_open,
]; fn syscalls() -> ContainerResult { let s_isuid: u64 = Mode::S_ISUID.bits().into(); let s_isgid: u64 = Mode::S_ISGID.bits().into(); let clone_newuser = CloneFlags::CLONE_NEWUSER.bits() as u64; // Each tuple: (SysCall, argument_idx, value). 0 would be the first argument index. let conditional_syscalls = [ (Syscall::fchmod, 1, s_isuid), (Syscall::fchmod, 1, s_isgid), (Syscall::fchmodat, 2, s_isuid), (Syscall::fchmodat, 2, s_isgid), (Syscall::unshare, 0, clone_newuser), (Syscall::clone, 0, clone_newuser), // TODO: ioctl causes an error when running /bin/ash somehow... // (Syscall::ioctl, 1, TIOCSTI), ]; match Context::init_with_action(Action::Allow) { Ok(mut ctx) => { for syscall in DISABLED_SYSCALLS { if let Err(err) = ctx.set_action_for_syscall(Action::Errno(0), syscall) { return Err(ContainerError::DisableSyscall); }; } for (syscall, arg_idx, bit) in conditional_syscalls { if let Err(err) = ctx.set_rule_for_syscall( Action::Errno(1000), syscall, &[Comparator::new(arg_idx, Cmp::MaskedEq, bit, Some(bit))], ) { return Err(ContainerError::DisableSyscall); } } if let Err(err) = ctx.load() { return Err(ContainerError::DisableSyscall); }; } Err(err) => { return Err(ContainerError::DisableSyscall); } } Ok(())
