My implementation takes in a list of capabilities to add and a list of capabilities to drop. If ALL is specified in cap-drop, then all capabilities are dropped. sudo target/debug/mini-container /bin/ash /home/brianshih/alpine --cap-drop ALL --cap-add NET_BIND_SERVICE CAP_SETUID Here is the pseudocode for the implementation: for each capability to drop, drop them. If the capability specified is ALL, then loop through any capabilities in the bounding set unless it’s inside the capabilities to add loop through the capabilities to add and add the capability set to the inheritable set and the ambient set. Here is the actual code: static CAPABILITIES: phf::Map<&'static str, Capability> = phf_map! { "NET_BIND_SERVICE" => caps::Capability::CAP_NET_BIND_SERVICE, "SETUID" => caps::Capability::CAP_SETUID, "CAP_SYS_TIME" => caps::Capability::CAP_SYS_TIME,
}; fn capabilities(config: &ChildConfig) -> ContainerResult { // compute the list of capabilities to add let caps_add: Vec<Capability> = match &config.cap_add { Some(cap_add) => { let mut res = vec![]; for c in cap_add.iter() { match CAPABILITIES.get(c) { Some(c) => { res.push(c.clone()); } None => { return Err(ContainerError::CapabilityAdd); } } } res } None => vec![], }; // if ALL is inside the capabilities to drop, then drop all capabilities except // for the ones inside capabilities to add if let Some(caps) = &config.cap_drop { if caps.contains(&String::from("ALL")) { let bounding_caps = caps::read(None, caps::CapSet::Bounding).unwrap(); for cap in bounding_caps.iter() { if !caps_add.contains(cap) { if let Err(e) = caps::drop(None, caps::CapSet::Bounding, *cap) { return Err(ContainerError::CapabilityDrop); } } } } else { for c in caps.iter() { match CAPABILITIES.get(c) { Some(c) => { if let Err(e) = caps::drop(None, caps::CapSet::Bounding, *c) { return Err(ContainerError::CapabilityDrop); } if let Err(e) = caps::drop(None, caps::CapSet::Inheritable, *c) { return Err(ContainerError::CapabilityDrop); } } None => { return Err(ContainerError::CapabilityDrop); } } } } } for cap in caps_add.iter() { if let Err(e) = caps::raise(None, caps::CapSet::Inheritable, *cap) { return Err(ContainerError::CapabilityAdd); } if let Err(e) = caps::raise(None, caps::CapSet::Ambient, *cap) { return Err(ContainerError::CapabilityAdd); } } Ok(())
}

